import React from "react";
import { Routes, Route, Link } from "react-router-dom";

import Checklist from "./Components/Checklist/checklist.component";
import EditList from "./Components/Edit-list/editlist.component";
import CreateList from "./Components/Create-list/createlist.component";

import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

export default function App() {
  return (
      <Routes>
        <div className="wrapper-app">
          <h2>Checklist Homepage</h2>
        </div>
        <Route path='/checklist' exact component={Checklist} />
        <Route path='/edit/:id' exact component={EditList} />
        <Route path='/create' exact component={CreateList} />
      </Routes>
  );
}
